(function(){});$(function(){var i=abp.services.app.auditLog,t=$("body"),n=$("form[name=select]");t.delegate("#clearHis","click",function(t){if(t.preventDefault(),n.valid()){var r={startTime:n.find("input[name=startTime]").val(),endTime:n.find("input[name=endTime]").val()};abp.message.confirm("你确定清理审计日志记录吗",function(n){n&&i.cleaningRecords(r.startTime,r.endTime).done(function(){abp.message.success("清理完成")})})}});t.delegate(".select-log","click",function(n){var t=$(this).attr("data-auditlogid");n.preventDefault();$.ajax({url:abp.appPath+"AuditLog/Details?id="+t,type:"POST",contentType:"application/html",success:function(n){$("#AuditLogDetailsModal div.modal-content").html(n)},error:function(){}})})});